CREATE TABLE ksProject(
   ID               INTEGER  NOT NULL PRIMARY KEY 
  ,name             VARCHAR(81) NOT NULL
  ,category         VARCHAR(17) NOT NULL
  ,main_category    VARCHAR(12) NOT NULL
  ,currency         VARCHAR(3) NOT NULL
  ,deadline         DATE  NOT NULL
  ,goal             NUMERIC(9,2) NOT NULL
  ,launched         VARCHAR(19) NOT NULL
  ,pledged          NUMERIC(10,2) NOT NULL
  ,state            VARCHAR(10) NOT NULL
  ,backers          INTEGER  NOT NULL
  ,country          VARCHAR(2) NOT NULL
  ,usd_pledged      NUMERIC(8,2) NOT NULL
  ,usd_pledged_real NUMERIC(10,2) NOT NULL
  ,usd_goal_real    NUMERIC(10,2) NOT NULL
);
